import React, { Component } from 'react'
const h4={
    alignItems:'center',
    color:'blue'
}
export class Body extends Component {
    render() {
        return (
            <div className="body">
                <div className="row">
                    <div className="col-md-6 ">
                        <div className="row"><h4 style={h4}>Who Are We</h4></div>
                        
                    </div>
                    <div className="col-md-6 ">
                        <div className="row text-align-center">
                        <div className="row"><h4 style={h4}>Who Are We</h4></div>
                            
                            </div>
                        
                    </div>
                </div>
            </div>
        )
    }
}

export default Body
